angular.module("index",[]).config(["$routeProvider",function(n){return n.when("/",{templateUrl:"/Content/app/index.tpl.html",controller:"IndexCtrl",title:"Home",showBanner:!0})}]).controller("IndexCtrl",["$scope","$http",function(n,t){return t.get("/Content/data/words.js").success(function(t){return n.$parent.word=t[Math.floor(Math.random()*t.length+1)-1]})}])